import React, { useEffect } from "react";
import { getEmployees } from "./actions/employees";
import { getToken } from "./actions/token";
import { getTeams } from "./actions/teams";
import { getAlliances } from "./actions/alliances";
import { useDispatch } from "react-redux";
import { HTML5Backend } from "react-dnd-html5-backend";
import { DndProvider } from "react-dnd";
import DragDrop from "./components/DragDrop";
import "./styles/App.css";

function App() {
  const dispatch = useDispatch();

  useEffect(async () => {
    try {
      const token = await dispatch(getToken());
      const employees = await dispatch(getEmployees());
      const teams = await dispatch(getTeams());
      const alliances = await dispatch(getAlliances());
    } catch (err) {
      console.log(err);
    }
  }, [dispatch]);
  return (
    <div>
      <div class="slider">
        <input
          type="radio"
          name="radio"
          id="radio01"
          class="radio"
          checked="checked"
        ></input>
        <input type="radio" name="radio" id="radio02" class="radio"></input>
        <input type="radio" name="radio" id="radio03" class="radio"></input>
        <input type="radio" name="radio" id="radio04" class="radio"></input>
        <input type="radio" name="radio" id="radio05" class="radio"></input>
        <div class="item" id="item01">
          <img
            src="https://unsplash.it/500/250?image=1021"
            alt="slide-image-01"
          ></img>
        </div>
        <div class="item" id="item02">
          <img
            src="https://unsplash.it/500/250?image=1032"
            alt="slide-image-02"
          ></img>
        </div>
        <div class="item" id="item03">
          <img
            src="https://unsplash.it/500/250?image=1023"
            alt="slide-image-03"
          ></img>
        </div>
        <div class="item" id="item04">
          <img
            src="https://unsplash.it/500/250?image=1024"
            alt="slide-image-04"
          ></img>
        </div>
        <div class="item" id="item05">
          <img
            src="https://unsplash.it/500/250?image=1035"
            alt="slide-image-05"
          ></img>
        </div>
        <label class="label" id="label01" for="radio01"></label>
        <label class="label" id="label02" for="radio02"></label>
        <label class="label" id="label03" for="radio03"></label>
        <label class="label" id="label04" for="radio04"></label>
        <label class="label" id="label05" for="radio05"></label>
        <span class="indicator">
          <label id="indicator01" for="radio01"></label>
        </span>
        <span class="indicator">
          <label id="indicator02" for="radio02"></label>
        </span>
        <span class="indicator">
          <label id="indicator03" for="radio03"></label>
        </span>
        <span class="indicator">
          <label id="indicator04" for="radio04"></label>
        </span>
        <span class="indicator">
          <label id="indicator05" for="radio05"></label>
        </span>
      </div>
    </div>
  );
}

export default App;
